export const postQuestionAndAnswerToDatabase = (object) => {
    return (
        fetch("http://localhost:8088/questionsAndAnswers", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(object),
        }).then((response) => response.json())
      )
}
